int unconvert(const char& c){
    if((unsigned)((c&0xDFU)-0x41U)<26U){
        if(c&0x20){
            return c - 'a';
        } else {
            return 26 + c - 'A';
        }
    } else if((unsigned)(c^0x30U)<10U){
        return 52 + c - '0';
    } else if(c == '+'){
        return 62;
    } else {
        return 63;
    }
}
uint64_t unzip(const string& s){
    uint64_t ret = 0;
    for(char c:s){
        ret = ((ret<<6)|unconvert(c));
    }
    return ret;
}
